@Injectable()
export class RtoService {

  getStates(): State[] {
    let states: State[] = [];
    rto.states.map(state => {
      states.push(new State({
        code: state.code,
        name: state.name
      }));
    });
    return states;
  }

  getRto(name: string) {
    if (name) {
      return rto.states.find(state => state.name == name).offices.map(office => new Rto(office));
    }
  }
}
